;; **
;;; We're going to implement Metropolis-Hastings inference in this model. Metropolis-Hastings requires a _proposal distribution_ for modifying a given expression. This proposal @@q(f' | f)@@ defines a conditional distribution over new function expressions @@f'@@ given a current expression @@f@@.
;;; 
;;; \begin{align}
;;; A(f \rightarrow f') &= 1 \wedge \frac{p(f', y)q(f | f')}{p(f, y)q(f' | f)}
;;; \end{align}
;;; 
;;; We need to be able to both sample from @@q(f' | f)@@, as well as compute the probabilty of the transition for a given pair of expressions.
;;; 
;;; We'll define a very simple proposal, which (with equal probability) changes the operation at random, changes the first value at random, or changes the second value at random.
;; **

;; **
;;; That is, we first sample with probabilty @@\frac{1}{3}@@ which of the three places to change. Then, at that particular location @@e \in \{0, 1, 2\}@@, we sample a new value for either the operation (if @@e = 0@@), or the current symbol (if @@e = 1@@ or @@e = 2@@). 
;;; 
;;; Note that in this case, _very_ conveniently, we actually have @@q(f' | f) = q(f | f')@@, which means we do not need to actually ever compute the probability of the proposal. This is known as a _symmetric proposal_. 
;;; 
;;; **EXERCISE** Show that, in fact, we do have @@\frac{q(f'|f)}{q(f|f')} = 1@@, and thus @@A(f \rightarrow f') = \frac{p(f', y)}{p(f, y)}@@.
;; **

;; @@
(defn sample-simple-proposal [prev-expr]
  (let [[op sym1 sym2] prev-expr
        which-to-change (sample (uniform-discrete 0 3))]
    ;;(println "[debug] changing:" which-to-change)
    (cond (= which-to-change 0) (list (sample-operation) sym1 sym2)
          (= which-to-change 1) (list op (sample-symbol) sym2)
          (= which-to-change 2) (list op sym1 (sample-symbol)))))
;;    next-expr))
;    (if (= next-expr prev-expr)
;      (sample-simple-proposal prev-expr)
;      next-expr)))

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;arithmetic-functions/sample-simple-proposal</span>","value":"#'arithmetic-functions/sample-simple-proposal"}
;; <=

;; @@
(let [prev (sample-simple)]
  (println prev "->" (sample-simple-proposal prev)))
;; @@
;; ->
;;; (- 7 x) -&gt; (- x x)
;;; 
;; <-
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; Now, we define the MH transition function below.
;; **

;; @@
(defn mh-transition-simple [prev-expr inputs outputs]
  (let [; compute p(f, y)
        prev-fn-vals (mapv (eval (make-fn prev-expr)) inputs)
        ;_ (println (score-likelihood prev-fn-vals outputs))
        prev-score (+ (score-simple prev-expr) (reduce + (score-likelihood prev-fn-vals outputs)))
        ; propose new f' from q(f' | f)
        next-expr (sample-simple-proposal prev-expr)
        ; compute p(f', y)
        next-fn-vals (mapv (eval (make-fn next-expr)) inputs)
		next-score (+ (score-simple next-expr) (reduce + (score-likelihood next-fn-vals outputs)))
        accept-ratio (exp (- next-score prev-score))]
    (if (sample (flip accept-ratio))
      [next-expr next-score]
      [prev-expr prev-score])))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;arithmetic-functions/mh-transition-simple</span>","value":"#'arithmetic-functions/mh-transition-simple"}
;; <=

;; **
;;; Now, define a function to run the MH sampler for a given number of samples, which takes `input` and `output` sequences as input.
;; **

;; @@
(defn run-mh-sampler [mh-transition inputs outputs num-samples]
  (let [init-expr (sample-simple)]
    (loop [samples []
           scores []
           prev-expr init-expr]
      (if (> (count samples) num-samples)
        {:samples samples :scores scores}
        (let [[next-expr next-score] (mh-transition prev-expr inputs outputs)]
          (recur (conj samples next-expr)
                 (conj scores next-score)
                 next-expr))))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;arithmetic-functions/run-mh-sampler</span>","value":"#'arithmetic-functions/run-mh-sampler"}
;; <=

;; @@
(time (def posterior (run-mh-sampler mh-transition-simple [2] [4] 500)))
