;; **
;;; We see that we generally draw very simple linear or constant functions, but on occassion will see something much more complex.
;;; 
;;; How do we write a scoring function for this generative model?
;; **

;; @@
(defn score-expr [expr]
  (cond (number? expr) 0.04
        (= 'x expr) 0.3
        :else (let [[op expr1 expr2] expr
                    expr-score (+ (score-operation op) (score-expr expr1) (score-expr expr2))]
                (+ 0.3 expr-score))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;arithmetic-functions/score-expr</span>","value":"#'arithmetic-functions/score-expr"}
;; <=

;; @@
(defn score-function [body]
  (let [[op sym1 sym2] body]
    (+ (score-operation op) (score-expr sym1) (score-expr sym2))))

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;arithmetic-functions/score-function</span>","value":"#'arithmetic-functions/score-function"}
;; <=

;; @@
(let [f (sample-function)]
  (println f)
  (score-function f))
;; @@
