;; <=

;; **
;;; How can we design a Metropolis-Hastings proposal for this model?
;;; 
;;; A proposal density @@q(f' | f)@@ needs to take as its input a function body @@f@@, and provide a density over different function bodies @@f'@@.
;;; 
;;; One approach, which is statistically inefficient, but conceptually and programmatically very simple, is to define a proposal density @@q(f')@@ which is _independent_ of the input function @@f@@.
;; **

;; @@
(defn independent-proposal [f]
  (sample-function))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;arithmetic-functions/independent-proposal</span>","value":"#'arithmetic-functions/independent-proposal"}
;; <=

;; @@
(defn mh-independent-proposals [prev-expr inputs outputs]
  (let [; compute p(f, y)
        prev-fn-vals (mapv (eval (make-fn prev-expr)) inputs)
        ;_ (println (score-likelihood prev-fn-vals outputs))
        prev-score (+ (score-function prev-expr) (reduce + (score-likelihood prev-fn-vals outputs)))
        ; propose new f' from q(f' | f)
        next-expr (sample-function)
        ; compute p(f', y)
        next-fn-vals (mapv (eval (make-fn next-expr)) inputs)
		next-score (+ (score-function next-expr) (reduce + (score-likelihood next-fn-vals outputs)))
        accept-ratio (exp (- next-score prev-score))]
    (if (sample (flip accept-ratio))
      [next-expr next-score]
      [prev-expr prev-score])))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;arithmetic-functions/mh-independent-proposals</span>","value":"#'arithmetic-functions/mh-independent-proposals"}
;; <=

;; @@
(time (def posterior-independent-proposals 
        (run-mh-sampler mh-independent-proposals more-inputs more-outputs 5000)))
;; @@
;; ->
;;; &quot;Elapsed time: 11482.127 msecs&quot;
;;; 
;; <-
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;arithmetic-functions/posterior-independent-proposals</span>","value":"#'arithmetic-functions/posterior-independent-proposals"}
;; <=

;; @@
(for [func (into #{} (drop 1000 (:samples posterior-independent-proposals)))]
  (do
    (plot/compose
      (plot-function (make-fn func))
      (plot/list-plot (map list more-inputs more-outputs)))))
